    true,nt"url": null,nt"notes": "Exports from Manufacturing Establishments
    includes estimates for the value of manufactured exports and related employment.
    Export estimates include both "direct" exports (exports manufactured in the United
    States and consumed in foreign markets) and supporting shipments (intermediate goods
    and services required to manufacture exported goods). The report includes estimates
    for state and national totals for direct exports, supporting shipments and related
    employment for the manufacturing sector. In addition, supporting employment outside
